import axios from "axios"

export const contentClicked = () => dispatch => {
    dispatch({ type: 'CONTENTEDITABLE_CLICKED' })
}

export const submitButtonClicked = (data) => dispatch => {
    dispatch({type: PAGE_CHANGE_SUBMITTED})
    axios.patch(`http://localhost:3001/pages/${data.id}`)
}
